import React from 'react'
import Days from './days'
import './logs-items.css'


export default function Items(props) {
  props.console.log();
  
  return (
        <div className='item'>
         
            <Days/>

            <div className='content'>
                <h2 className='desc'>{props.desc}</h2>
                <div className='time'>{props.time}</div>
            </div>

      </div>

  )
}
